import React from "react";

function Sections(props){
    return (
        <div>
            <h4>{this.header}</h4>
            <p>{this.para}</p>
        </div>
    )   
}

const AboutUs = (props) => {
    return ( 
        <div style={{ paddingTop: "120pt", paddingBottom: "120pt", background: "#010101", color:"#eeeeee"}}>
            <h1>How We Work</h1>
            <Sections header="you" para="fdsfdf"/>
            <Sections header="no" para="dsffsf" />
        </div>
     );
}

export default AboutUs;
